const k = require("../images/kociak.jpg");
const rose = require("../images/rose.gif")


export const Niespodzianka = () => {
  return (
    <div>
      <h1 style={{textAlign: "center", color: "crimson"}}> Dla Oli</h1>
      <div><img style={{height: "75vh", textAlign: "center"}} src={rose} /></div>
      
    </div>
  )
}
